var __index = {"config":{"lang":["pt"],"separator":"[\\s\\-]+","pipeline":["stopWordFilter"]},"docs":[{"location":"index.html","title":"INFORMA\u00c7\u00d5ES DE RENDA VARIAV\u00c9L","text":""},{"location":"index.html#objetivo","title":"Objetivo","text":"<p>Esta documenta\u00e7\u00e3o tem por objetivo te ajudar a conhecer melhor o universo da renda vari\u00e1vel, te ajudar a ganhar dinheiro e quem sabe me sustentar tamb\u00e9m. A se\u00e7\u00e3o est\u00e1 dividida em algumas etapas que seguem:</p>"},{"location":"index.html#corretoras","title":"Corretoras","text":"<p>Essa se\u00e7\u00e3o tem como fun\u00e7\u00e3o explicar os benef\u00edcios e malef\u00edcios das tr\u00eas principais corretoras do pa\u00eds. Sendo estas:</p> <ol> <li>Nuinvest</li> <li>Rico</li> <li>XP Corretora</li> </ol>"},{"location":"index.html#acoes","title":"A\u00e7\u00f5es","text":"<p>Essa se\u00e7\u00e3o \u00e9 para tratar especificamente sobre a classe mais comum de ativos: as a\u00e7\u00f5es. As a\u00e7\u00f5es s\u00e3o \"peda\u00e7os\" de uma empresa e elas podem ser divididas em duas:</p> <ol> <li>Valor</li> <li>Dividentos</li> </ol>"},{"location":"index.html#fiis","title":"FII's","text":"<p>J\u00e1 esta se trata sobre os Fundos Imboli\u00e1rios, ou popularmente conhecidos como FII's. Estes s\u00e3o fundos que gerenciam im\u00f3veis e s\u00e3o divididos em tr\u00eas categorias:</p> <ol> <li>Tijolo</li> <li>Pap\u00e9is</li> <li>Misto</li> </ol>"},{"location":"index.html#etfs","title":"ETF's","text":"<p>Esta se\u00e7\u00e3o trata especificamente sobre ETF's que \u00e9 parecido com uma a\u00e7\u00e3o. Existem diversos ETF's dispon\u00edveis na bolsa e vamos falar de tr\u00eas em especifico.</p>"},{"location":"index.html#bdrs","title":"BDR's","text":"<p>Os BDR's \u00e9 a forma mais pr\u00e1tica de expor seu patrim\u00f4nia ao d\u00f3lar, investindo em empresas do exterior. Dessa forma voc\u00ea consegue investir atrav\u00e9s de uma corretora nacional, sem precisar abrir uma conta no exterior.</p> <p>Qualquer d\u00favida \u00e9 s\u00f3 me procurar!</p>"},{"location":"acoes/index.html","title":"A\u00c7\u00d5ES","text":"<p>Esta \u00e9 a principal classe de ativo que \u00e9 poss\u00edvel se obter atrav\u00e9s das corretoras. A a\u00e7\u00e3o nada mais que um peda\u00e7o da empresa que voc\u00ea adquire, dependendo de classe do ativo e tamb\u00e9m da quantidade, fazer parte do conselho de acionistas. Isso \u00e9 diferenciado pelo n\u00famero final do c\u00f3digo da a\u00e7\u00e3o:</p> <ol> <li>Final 3: A\u00e7\u00e3o Ordin\u00e1ria que d\u00e1 direito a voto</li> <li>Final 4: A\u00e7\u00e3o preferencial</li> </ol> <p>Hoje \u00e9 poss\u00edvel investir em mais de 400 empresas nacionais, al\u00e9m de internacionais. Cada empresa possui um c\u00f3digo pr\u00f3prio formado por QUATRO letras e UM n\u00famero.</p> <p>Exemplo: Ita\u00fa Unibanco SA -&gt; ITUB4 ou ITUB3</p> <p>As a\u00e7\u00f5es tamb\u00e9m podem ser divididas em duas categorias:</p>"},{"location":"acoes/index.html#valor","title":"Valor","text":"<p>Esse tipo de a\u00e7\u00e3o s\u00e3o de empresas que possuem ainda um potencial de crescimento interessante ou que n\u00e3o planejam dividir seus lucro entre os acionistas (dividendos). Normalmente s\u00e3o empresas consolidadas que querem reinvestir seu dinheiro: Alguns exemplos:</p> <ol> <li>CCRO3 - CCR</li> <li>TIMS3 - TIM Brasil</li> <li>BRKM5 - Braskem</li> </ol>"},{"location":"acoes/index.html#dividendos","title":"Dividendos","text":"<p>Esse tipo de a\u00e7\u00e3o ela fornece proventos em determinados per\u00edodos (\u00e0s vezes mensalmente, ou a cada dois meses) como forma de remunerar seus investidores. \u00c9 uma forma de atrair mais investidores, ou para empresas que n\u00e3o querem reinvestir tanto seu lucro operacional. Alguns exemplos:</p> <ol> <li>ITSA4 - Ita\u00fasa</li> <li>VALE3 - Vale</li> <li>PETR4 - Petrobras</li> </ol>"},{"location":"bdrs/index.html","title":"Documenta\u00e7\u00e3o do Lakehouse","text":""},{"location":"bdrs/index.html#lavoro-cdp","title":"Lavoro CDP","text":"<p>Data Lake no GCP Google Cloud Platform, solu\u00e7\u00e3o da google na nuvem para projetos empresariais. Usando o BigQuery como armaz\u00e9m de dados, para grande volume de dados, com objetivos de servir, apoiar em data discovery, gera\u00e7\u00e3o de relat\u00f3rios e dashboard interativos, subsidiar com dados e informa\u00e7\u00f5es \u00e0 tomada de decis\u00e3o para os n\u00edveis t\u00e1tico e estrat\u00e9gico da Lavoro</p>"},{"location":"bdrs/index.html#objetivo","title":"Objetivo","text":"<p>Ser um Data Lake, reposit\u00f3rio de dados de diversos formatos e tamanhos, armaz\u00e9m de dados, para apoiar diversas \u00e1reas de neg\u00f3cios: marketing, growth, comercial, financeiro, solu\u00e7\u00e3o de Business intelligence, servindo a ferramentas de data discovery \u201cGoogle Data Studio, Power BI\u201d e contribuindo para construir Dashboards interativos e relat\u00f3rios gerenciais. Apoiando os n\u00edveis t\u00e1tico e estrat\u00e9gico na tomada de decis\u00e3o.  </p>"},{"location":"bdrs/index.html#solicitante","title":"Solicitante","text":"<p>\u00c1rea de Dados \u201cLavoro\u201d.</p>"},{"location":"bdrs/index.html#projeto","title":"Projeto","text":""},{"location":"corretoras/index.html","title":"CORRETORAS","text":"<p>As corretoras s\u00e3o o meio em que voc\u00ea consegue investir em a\u00e7\u00f5es. \u00c9 atrav\u00e9s delas que voc\u00ea insere o dinheiro e negocia na bolsa de valores os ativos que te interessam.</p> <p>Existem in\u00fameras corretoras dentro do Brasil: \u00c1gora, Nuinvest, Rico, XP e outras. Elas funcionam como bancos e possuem seus pr\u00f3s e contras:</p>"},{"location":"corretoras/index.html#nuinvest","title":"Nuinvest","text":"<p>A Nuinvest, antiga Easynvest, \u00e9 a corretora da pr\u00f3pria Nubank. Sua principal vantagem est\u00e1 relacionada a praticidade e como com alguns cliques ou toques, \u00e9 poss\u00edvel j\u00e1 comprar o seu primeiro ativo.</p> <p>Ela n\u00e3o possui muito conte\u00fado como carteiras recomendadas e tamb\u00e9m sobre investimentos em si, mas est\u00e3o investindo fortemente nessa \u00e1rea para criar um portal de conte\u00fado e comunidade interessante. Outra desvantagem \u00e9 que ela n\u00e3o possui fundos interessantes para se investir, caso tenha interesse em renda fixa.</p> <p>Seu portal desktop tamb\u00e9m \u00e9 pouco funcional, apesar de pr\u00e1tico</p> <p>Ela n\u00e3o possui taxa de corretagem para a\u00e7\u00f5es, mas possui para FII e BDR(R$ 0,03)</p>"},{"location":"corretoras/index.html#rico","title":"Rico","text":"<p>A Rico \u00e9 uma corretora associada a XP Investimentos, que foi adquirida h\u00e1 pouco tempo.</p> <p>Possui uma gama interessante de fundos, mas \u00e9 preciso um pouco mais de traquejo para conseguir usufruir do aplicativo. A vers\u00e3o desktop cont\u00fado \u00e9 bem mais pr\u00e1tica de ser utilizada, inclusive com um portal de conte\u00fado bacana.</p> <p>Por\u00e9m, muitos dos conte\u00fados s\u00e3o defasados ou est\u00e3o fora.</p> <p>Tamb\u00e9m possui taxa de corretagem zero.</p>"},{"location":"corretoras/index.html#xp","title":"XP","text":"<p>A XP \u00e9 a maior corretora do pa\u00eds e possui sen\u00e3o a maior, uma das maiores carteiras de clientes. Ela possui fundos bastante interessantes e tamb\u00e9m excelentes fundos para previd\u00eancia privada (recomendo MUITO voc\u00ea fazer uma, se a empresa n\u00e3o der).</p> <p>Possui um atendimento personalizado e tanto a vers\u00e3o desktop e aplicativo s\u00e3o bem completas, em contrapartida, complexas de serem utilizadas.</p> <p>Ela possui uma taxa de corretagem para a\u00e7\u00f5es, portanto n\u00e3o recomendo o investimento atrav\u00e9s dela.</p>"},{"location":"etfs/index.html","title":"Documenta\u00e7\u00e3o do Lakehouse","text":""},{"location":"etfs/index.html#lavoro-cdp","title":"Lavoro CDP","text":"<p>Data Lake no GCP Google Cloud Platform, solu\u00e7\u00e3o da google na nuvem para projetos empresariais. Usando o BigQuery como armaz\u00e9m de dados, para grande volume de dados, com objetivos de servir, apoiar em data discovery, gera\u00e7\u00e3o de relat\u00f3rios e dashboard interativos, subsidiar com dados e informa\u00e7\u00f5es \u00e0 tomada de decis\u00e3o para os n\u00edveis t\u00e1tico e estrat\u00e9gico da Lavoro</p>"},{"location":"etfs/index.html#objetivo","title":"Objetivo","text":"<p>Ser um Data Lake, reposit\u00f3rio de dados de diversos formatos e tamanhos, armaz\u00e9m de dados, para apoiar diversas \u00e1reas de neg\u00f3cios: marketing, growth, comercial, financeiro, solu\u00e7\u00e3o de Business intelligence, servindo a ferramentas de data discovery \u201cGoogle Data Studio, Power BI\u201d e contribuindo para construir Dashboards interativos e relat\u00f3rios gerenciais. Apoiando os n\u00edveis t\u00e1tico e estrat\u00e9gico na tomada de decis\u00e3o.  </p>"},{"location":"etfs/index.html#solicitante","title":"Solicitante","text":"<p>\u00c1rea de Dados \u201cLavoro\u201d.</p>"},{"location":"etfs/index.html#projeto","title":"Projeto","text":""},{"location":"fiis/index.html","title":"FUNDOS IMBOLI\u00c1RIOS","text":""}]}